import logo from './logo.svg';
import './App.css';
import Login from './views/Login';
import { Routes, Route, BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
        <div className="App">
            <Routes>
                <Route path="/" element={Login} />
                <Route path="/login" element={Login} />
            </Routes>
        </div>  
    </BrowserRouter>
  );
}

export default App;
